import React, { FC } from "react";
import DataTable from "react-data-table-component";
import "../vitasdash/VitasDashcss/dash1.css";

// Define the columns for the DataTable
const columns = [
  {
    name: "Name",
    selector: (row: any) => row.name,
    sortable: true,
  },
  {
    name: "Email",
    selector: (row: any) => row.email,
    sortable: true,
  },
  {
    name: "Age",
    selector: (row:any) => row.age,
    sortable: true,
  },
];

// Example data for the DataTable
const data = [
  { id: 1, name: "John Doe", email: "john.doe@example.com", age: 28 },
  { id: 2, name: "Jane Smith", email: "jane.smith@example.com", age: 34 },
  // Add more rows as needed
];

const Dash1: FC = () => {
  return (
    <div className="table-wrapper">
      <DataTable
        columns={columns}
        data={data}
        pagination // Adds pagination to the table
      />
    </div>
  );
};

export default Dash1;

